<h2 id="_2-图像预处理" tabindex="-1"><a class="header-anchor" href="#_2-图像预处理" aria-hidden="true">#</a> 2. 图像预处理</h2>
<p>在对图像中的皮肤部分进行提取之前为了能够得到更好的效果，需要对图像进行必要的图像处理，去掉椒盐噪声，并且使图像的颜色接近的区域更加连续。在提取图像中的之前，有必要使得图像的边缘更加清晰，这样不仅可以提高识别的准确度 而且可以保证算法的稳定性。</p>
<p>两种主要的处理方法：</p>
<ul>
<li>中值滤波</li>
<li>高斯滤波</li>
</ul>
<p>高斯滤波实质上是一种信号的滤波器，其用途是信号的平滑处理，人们知道数字图像用于后期应用，其噪声是最大的问题，由于误差会累计传递等原因，很多图像处理教 材会在很早的时候介绍 Gauss 滤波器，用于得到信噪比 SNR 较高的图像（反应真实信号）。与此相关的有 Gauss-Laplace 变换，其实就是为了得 到较好的图像边缘，先对图像做 Gauss 平滑滤波，剔除噪声，然后求二阶导矢，用二阶导的过零点确定边缘，在计算时也是频域乘积空域卷积。</p>
