<h2 id="_7-动态手势识别" tabindex="-1"><a class="header-anchor" href="#_7-动态手势识别" aria-hidden="true">#</a> 7. 动态手势识别</h2>
<p>目前尚不需要实现过于复杂的功能（只需获得当前轮廓的质心即可），相邻帧间的轮廓的质心位置变化可得动态特征向量。如果需要扩展，有两种可供选择的方式：</p>
<ul>
<li>统计并保存有效轮廓质心的位置，形成轨迹，与模版进行对比，或者采用与文字识别同样方式取得轨迹特征向量，以支持向量机的方式进行分类识别。</li>
<li>根据动态特征向量，转换为角度的方式进行动态特征编码，采集编码序列，通过 Hmm 方式进行识别或者采用取间隔的动态特征编码作为特征向量，采用支持向量机的形式进行识别。</li>
</ul>
